INSERT INTO `product` (`Id_product`, `Product_name`, `Description`, `Type`, `Foodtype`, `Picture`, `Price`, `brand`) VALUES
(1, 'Jerhigh More Grain Free สูตรไก่เนื้อ 500 g\r\n', 'อาหารเม็ด สำหรับสุนัข ไม่ผสมข้าวโพด ถั่วเหลือง และ กลูเตน ลดอาการแพ้ ควบคุมปริมาณเกลือ', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer1.png', 109, 'Jerhigh'),
(2, 'Jerhigh More Grain Free สูตรไก่ 500 g', 'อาหารเม็ด สำหรับสุนัข ไม่ผสมข้าวโพด ถั่วเหลือง และ กลูเตน ลดอาการแพ้ ควบคุมปริมาณเกลือ', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer2.png', 109, 'Jerhigh'),
(3, 'Jerhigh More Grain Free สูตรไก่ตับ 500 g\r\n', 'อาหารเม็ด สำหรับสุนัข ไม่ผสมข้าวโพด ถั่วเหลือง และ กลูเตน ลดอาการแพ้ ควบคุมปริมาณเกลือ', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer3.png', 109, 'Jerhigh'),
(4, 'Jerhigh Breeders สูตรเนื้อ 15kg', 'อาหารเม็ด สำหรับสุนัข จากกระดูกปลาฉลาม ช่วยบำรุงข้อต่อและกระดูกให้แข็งแรง ช่วยบำรุงผิวหนังและเส้นขน ลดกลิ่นมูล', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer4.png', 1350, 'Jerhigh'),
(5, 'Jerhigh Meat as meals สูตรไก่กับไข่ 500g\r\n', 'อาหารเม็ด สำหรับสุนัข มีสัดส่วนเนื้อไก่แท้มากกว่า 50%', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer5.png', 225, 'Jerhigh'),
(6, 'Jerhigh Meat as meals สูตรไก่กับแครอท 500g', 'อาหารเม็ด สำหรับสุนัข มีสัดส่วนเนื้อไก่แท้มากกว่า 50% โอเมก้า 3 และ 6 ช่วยบำรุงผิวหนังและเส้นขน กลูโคซามีน และคอนดรอยตินบำรุงกระดูกและข้อ อินนูลิน สร้างสมดุลระบบทางเดินอาหาร เหมาะสำหรับสุนัขอายุ 3 เดือนขึ้นไป', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer6.png', 225, 'Jerhigh'),
(7, 'Jerhigh Meat as meals สูตรแซลมอล 500 g', 'อาหารเม็ด สำหรับสุนัขสายพันธุ์เล็ก แชลมอน 100% มีส่วนผสมของไก่ วิตามินและแร่ธาตุรวม 18 ชนิด', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer7.png', 240, 'Jerhigh'),
(8, 'Jerhigh Meat as meals สูตรไก่และฟักทอง 500 g', 'อาหารเม็ด สำหรับสุนัข วิตามินและแร่ธาตุรวม 18 ชนิด โอเมก้า 3,6', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer8.png', 225, 'Jerhigh'),
(9, 'Jerhigh Meat as meals สูตรเนื้อ 500 g', 'อาหารเม็ด สำหรับสุนัขสายพันธุ์เล็ก วิตามินและแร่ธาตุรวม 18 ชนิด โอเมก้า 3,6', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer9.png', 225, 'Jerhigh'),
(10, 'Jerhigh Meat as meals สูตรไก่ 500 g', 'อาหารเม็ด สำหรับสุนัขสายพันธุ์เล็ก วิตามินและแร่ธาตุรวม 18 ชนิด โอเมก้า 3,6', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/jerhigh/ข้าวjer10.png', 225, 'Jerhigh'),
(11, 'Jerhigh สูตรสตูไก่สูตรผสมโกจิเบอร์รี่และผัก 200 g', 'อาหารเปียก แบบถ้วย สำหรับสุนัขโตทุกสายพันธุ์ มี วิตามินซี และสารต้านอนุมูลอิสระ ช่วยเสริมสร้างระบบภูมิคุ้มกันให้ร่างกาย อัดแน่นด้วยไฟเบอร์ ช่วยในเรื่องการขับถ่าย', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer1.png', 59, 'Jerhigh'),
(12, 'Jerhigh สูตรสตูเนื้อสูตรผสมแครนเบอรร์รี่และผัก 200 g', 'อาหารเปียก แบบถ้วย สำหรับสุนัขโตทุกสายพันธุ์ มี วิตามินซี และสารต้านอนุมูลอิสระ ช่วยเสริมสร้างระบบภูมิคุ้มกันให้ร่างกาย อัดแน่นด้วยไฟเบอร์ ช่วยในเรื่องการขับถ่าย', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer2.png', 59, 'Jerhigh'),
(13, 'Jerhigh hotdog bar รสไก่และผัก 150 g\r\n', 'อาหารเปียก สำหรับสุนัข สินค้าเป็นแท่งทรงกระบอกลักษณะคล้ายไส้กรอก เนื้อปลาล้วน เสริมวิตามินอี โปรตีนไม่น้อยกว่า 10% ไขมันไม่น้อยกว่า 05% กาก ไม่น้อยกว่า 2% ความชื้นไม่น้อยกว่า 65%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer3.png', 45, 'Jerhigh'),
(14, 'Jerhigh hotdog bar รสไก่ 150 g\r\n', 'อาหารเปียก สำหรับสุนัข สินค้าเป็นแท่งทรงกระบอกลักษณะคล้ายไส้กรอก เนื้อปลาล้วน เสริมวิตามินอี โปรตีนไม่น้อยกว่า 10% ไขมันไม่น้อยกว่า 05% กาก ไม่น้อยกว่า 2% ความชื้นไม่น้อยกว่า 65%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer4.png', 45, 'Jerhigh'),
(15, 'Jerhigh hotdog bar รสตับ 150 g\r\n', 'อาหารเปียก สำหรับสุนัข สินค้าเป็นแท่งทรงกระบอกลักษณะคล้ายไส้กรอก เนื้อปลาล้วน เสริมวิตามินอี โปรตีนไม่น้อยกว่า 10% ไขมันไม่น้อยกว่า 05% กาก ไม่น้อยกว่า 2% ความชื้นไม่น้อยกว่า 65%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer5.png', 45, 'Jerhigh'),
(16, 'Jerhigh รสเนื้อวัวย่างแครอทน้ำเกรวี่ 120g', 'อาหารเปียก สำหรับสุนัข โอเมก้า 3 แร่ธาตุสังกะสี โปรตีน ไม่น้อยกว่า 4% ไขมันไม่น้อยกว่า 4% กากไม่น้อยกว่า 2% ความชื้น ไม่น้อยกว่า 82%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer6.png', 22, 'Jerhigh'),
(17, 'Jerhigh รสเป็ดย่างน้ำเกรวี่120g', 'อาหารเปียก สำหรับสุนัข โอเมก้า 3 แร่ธาตุสังกะสี โปรตีน ไม่น้อยกว่า 4% ไขมันไม่น้อยกว่า 4% กากไม่น้อยกว่า 2% ความชื้น ไม่น้อยกว่า 82%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer7.png', 22, 'Jerhigh'),
(18, 'Jerhigh รสไก่ผักน้ำเกรวี่120g', 'อาหารเปียก สำหรับสุนัข วิตามิน อี โปรตีนไม่น้อยกว่า 6% ไขมันไม่น้อยกว่า 6% กากไม่น้อยกว่า 3% ความชื้น ไม่น้อยกว่า 78%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer8.png', 22, 'Jerhigh'),
(19, 'Jerhigh รสเนื้อไก่ย่างน้ำเกรวี่120g', 'อาหารเปียก สำหรับสุนัข วิตามิน อี โปรตีนไม่น้อยกว่า 6% ไขมันไม่น้อยกว่า 6% กากไม่น้อยกว่า 3% ความชื้น ไม่น้อยกว่า 78%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer9.png', 22, 'jerhigh'),
(20, 'Jerhigh รสไก่ตับน้ำเกรวี่120g', 'อาหารเปียก สำหรับสุนัข วิตามิน อี โปรตีนไม่น้อยกว่า 6% ไขมันไม่น้อยกว่า 6% กากไม่น้อยกว่า 3% ความชื้น ไม่น้อยกว่า 78%', 'สุนัข', 'อาหารเปียก', 'อาหารหมา/jerhigh/เปียกjer10.png', 22, 'Jerhigh'),
(21, 'Jerhigh สันในไก่อบแห้ง  50 g\r\n', 'ขนมแท่ง สำหรับสุนัข โปรตีนเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด ช่วยในกระบวนการเผาผลาญ บำรุงสมอง และเสริมสร้างกระดูกให้แข็งแรง', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer1.png', 49, 'Jerhigh'),
(22, 'Jerhigh Den-T รสทูน่า 60 g\r\n', 'ขนมแท่งขัดฟัน สำหรับสุนัข โปรตีนเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด ช่วยในกระบวนการเผาผลาญ บำรุงสมอง และเสริมสร้างกระดูกให้แข็งแรง', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer2.png', 49, 'Jerhigh'),
(23, 'Jerhigh Den-T รสนม 60 g\r\n', 'ขนมแท่งขัดฟัน สำหรับสุนัข โปรตีนเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด ช่วยในกระบวนการเผาผลาญ บำรุงสมอง และเสริมสร้างกระดูกให้แข็งแรง', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer3.png', 49, 'Jerhigh'),
(24, 'Jerhigh รสตับ 70g\r\n', 'ขนมแท่ง สำหรับสุนัข โปรตีนเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด โปรตีนไม่น้อยกว่า 24% ไขมันไม่น้อยกว่า 12% กากไม่มากกว่า 6% ความชื้นไม่มากกว่า 20%', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer4.png', 49, 'Jerhigh'),
(25, 'Jerhigh รสไก่และผักขม 70g\r\n', 'ขนมแท่ง สำหรับสุนัข ประกอบไปด้วยโปรตีนที่ช่วยเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด ช่วยในกระบวนการเผาผลาญ บำรุงสมอง และเสริมสร้างกระดูกให้แข็งแรง', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer5.png', 49, 'Jerhigh'),
(26, 'Jerhigh รสไก่และแครอท 70g\r\n', 'ขนมแบบแท่ง สำหรับสุนัข ประกอบไปด้วยโปรตีนที่ช่วยเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด ช่วยในกระบวนการเผาผลาญ บำรุงสมอง และเสริมสร้างกระดูกให้แข็งแรง', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer6.png', 49, 'Jerhigh'),
(27, 'Jerhigh รสไก่และสตรอว์เบอร์รี 70g\r\n', 'ขนมแบบแท่ง สำหรับสุนัข โปรตีนเสริมสร้างกล้ามเนื้อ วิตามินและแร่ธาตุรวม 18 ชนิด ช่วยในกระบวนการเผาผลาญ บำรุงสมอง และเสริมสร้างกระดูกให้แข็งแรง', 'สุนัข', 'ขนม', 'อาหารหมา/jerhigh/ขนมjer7.png', 49, 'Jerhigh'),
