(31, 'Pedigree Pro ลูกสุนัขทุกสายพันธุ์ ', 'อาหารเม็ด สำหรับลูกสุนัข สูตรไฮโปรตีน สำหรับลูกสุนัข ถูกพัฒนาให้มีโปรตีนสูง 32% ซึ่งเป็นปริมาณที่เหมาะสมและรองรับการเจริญเติบโตอย่างแข็งแรง ทั้งยังมีดีเอชเอจากน้ำมันปลาเพื่อเสริมพัฒนาการสมอง พร้อมด้วยสารต้านอนุมูลอิสระที่ช่วยเพิ่มภูมิคุ้มกัน และสารอาหารจำเป็น 6 ชนิด สำหรับสุขภาพหัวใจที่แข็งแรง', 'สุนัข', 'อาหารเม็ด', 'อาหารหมา/pedigree/ข้าวped1.png', 300, 'Pedigree'),
